import React from 'react';
import List from '../List/List';
import CountryContextConsumer from '../Countries/CountryInterface';

const data = [
    {
        class: "first",
        label: "first label",
        content: "first content"
    },
    {
        class: "second",
        label: "second label",
        content: "second content"
    },
    {
        class: "third",
        label: "third label",
        content: "third content"
    }

];

const CountryList: React.FC = () => {
    return <ul>
        <CountryContextConsumer>
        {data.map((c) => {
                return <List class={c.class} label={c.label}>{c.content}</List>
            })
        }
        </CountryContextConsumer>
    </ul>
};

export default CountryList;
